import "./EditProfile.css"
import { Box, Modal } from '@mui/material'
function EditProfile({ user, loggedInUser }) {
  const style={
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 600,
    height: 600,
    bgcolor: 'background.paper',
    boxShadow: 24,
    borderRadius: 8,
  }
  const [open, setopen] = React.useState(false)
  const [name, setname] = React.useState(false)
  const [bio, setbio] = React.useState(false)
  const [location, setlocation] = React.useState(false)
  const [website, setwebsite] = React.useState(false)
  const [dob, setdob] = React.useState(false)
  return (
    <div>
      <button className='Edit-profile-btn' onClick={()=>setopen(true)}>Edit Profile</button>
      <Modal
      open= {open}
      aria-labelledby="modal-modal-title"
      aria-describedby="modal-modal-description"
      >
        <Box xx={style} className="modal">
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </Box>
      </Modal>
    </div>
  )
}

export default EditProfile
